import React from 'react';
import { Div, Button, Notification, Icon } from "atomize";


class Success extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
          successDark: false,
          warningDark: false,
          infoDark: false,
          dangerDark: false,
        };
      }

      render() {

        const { successDark } = this.state;
        return (
            <Notification
              bg="success700"
              isOpen={successDark}
              onClose={() => this.setState({ successDark: false })}
              prefix={
                <Icon
                    name="Success"
                    color="white"
                    size="18px"
                    m={{ r: "0.5rem" }} />}
            >
            Successfully minted
        </Notification>
        )
      }
    }

export default Success;
